import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './vacancyNavbar.css';
import logo from '../../assets/1.png';

function VacancyNavbar() {
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <header className="navbar">
      <div className="nav-left">
        <img src={logo} alt="SLT Logo" className="logo" />
        <h1 className="program-title">Training Program</h1>
      </div>

      {/* Hamburger icon */}
      <div className="hamburger" onClick={() => setMenuOpen(!menuOpen)}>
        <div />
        <div />
        <div />
      </div>

      {/* Navigation Links */}
      <nav className="vacancy-navbar">
        <div className={`nav-links ${menuOpen ? "open" : ""}`}>
          <Link to="/applied-job" onClick={() => setMenuOpen(false)}>Job Status</Link>
          <Link to="/apply" onClick={() => setMenuOpen(false)}>Apply for Job</Link>
          <Link to="/vacancy-creation" onClick={() => setMenuOpen(false)}>Jobs for You</Link>
          <Link to="/" onClick={() => setMenuOpen(false)}>Home</Link>
          <Link to="/login" onClick={() => setMenuOpen(false)}>Login</Link>
        </div>
      </nav>
    </header>
  );
}

export default VacancyNavbar;
